Citizen.CreateThread(function()

	while ESX == nil do
		TriggerEvent('esx:getSharedObject', function(obj) ESX = obj end)
		Citizen.Wait(0)
	end

	ESX.TriggerServerCallback('esx_vehicleshop:getCategories', function(categories)
		Categories = categories
	end)

	ESX.TriggerServerCallback('esx_vehicleshop:getVehicles', function(vehicles)
		Vehicles = vehicles
	end)

end)

function OpenShopMenu()

	ESX.UI.Menu.CloseAll()

	local playerPed = GetPlayerPed(-1)

	FreezeEntityPosition(playerPed, true)
	SetEntityVisible(playerPed, false)
	SetEntityCoords(playerPed, Config.Zones.ShopInside.Pos.x, Config.Zones.ShopInside.Pos.y, Config.Zones.ShopInside.Pos.z)

	local vehiclesByCategory = {}
	local elements           = {}
	local firstVehicleData   = nil

	for i=1, #Categories, 1 do
		vehiclesByCategory[Categories[i].name] = {}
	end

	for i=1, #Vehicles, 1 do
		table.insert(vehiclesByCategory[Vehicles[i].category], Vehicles[i])
	end

	for i=1, #Categories, 1 do

		local category         = Categories[i]
		local categoryVehicles = vehiclesByCategory[category.name]
		local options          = {}

		for j=1, #categoryVehicles, 1 do
			
			local vehicle = categoryVehicles[j]

			if i == 1 and j == 1 then
				firstVehicleData = vehicle
			end

			table.insert(options, vehicle.name .. ' $' .. vehicle.price)
		end

		table.insert(elements, {
			name    = category.name,
			label   = category.label,
			value   = 0,
			type    = 'slider',
			max     = #Categories[i],
			options = options
		})

	end

	ESX.UI.Menu.Open(
		'default', GetCurrentResourceName(), 'vehicle_shop',
		{
			title    = 'Concessionnaire',
			align    = 'top-left',
			elements = elements
		},
		function(data, menu)

			local vehicleData = vehiclesByCategory[data.current.name][data.current.value + 1]

			ESX.UI.Menu.Open(
				'default', GetCurrentResourceName(), 'shop_confirm',
				{
					title = 'Acheter ' .. vehicleData.name .. ' pour $' .. vehicleData.price .. ' ?',
					align = 'top-left',
					elements = {
						{label = 'Oui', value = 'yes'},
						{label = 'Non', value = 'no'},
					}
				},
				function(data2, menu2)

					menu2.close()

					if data2.current.value == 'yes' then

						if Config.EnablePlayerManagement then

							ESX.TriggerServerCallback('esx_vehicleshop:buyVehicleSociety', function(hasEnoughMoney)

								if hasEnoughMoney then
									ESX.ShowNotification('Vous avez acheté un véhicule')
								else
									ESX.ShowNotification('Vous n\'avez pas assez d\'argent sur votre compte société')
								end

							end, vehicleData.model)

						else

							menu2.close()
							menu.close()

							ESX.TriggerServerCallback('esx_vehicleshop:buyVehicle', function(hasEnoughMoney)

								if hasEnoughMoney then

									if IsAnyVehicleNearPoint(Config.Zones.ShopInside.Pos.x, Config.Zones.ShopInside.Pos.y, Config.Zones.ShopInside.Pos.z, 3.0) then
											
										local vehicle, distance = ESX.Game.GetClosestVehicle({
											x = Config.Zones.ShopInside.Pos.x,
											y = Config.Zones.ShopInside.Pos.y,
											z = Config.Zones.ShopInside.Pos.z
										})
										
										if distance <= 3.0 then
											DeleteVehicle(vehicle)
										end
									
									end

									ESX.Game.SpawnVehicle(vehicleData.model, {
										x = Config.Zones.ShopOutside.Pos.x,
										y = Config.Zones.ShopOutside.Pos.y,
										z = Config.Zones.ShopOutside.Pos.z
									}, -20.0, function(vehicle)
										
										TaskWarpPedIntoVehicle(playerPed, vehicle, -1)

										local vehicleProps = ESX.Game.GetVehicleProperties(vehicle)

										TriggerServerEvent('esx_vehicleshop:setVehicleOwned', vehicleProps)

									end)

									FreezeEntityPosition(playerPed, false)
									SetEntityVisible(playerPed, true)

								else
									ESX.ShowNotification('Vous n\'avez pas assez d\'argent')
								end

							end, vehicleData.model)

						end

					end

					if data2.current.value == 'no' then

					end

				end,
				function(data2, menu2)
					menu2.close()
				end
			)

		end,
		function(data, menu)
			
			menu.close()

			local playerPed = GetPlayerPed(-1)

			CurrentAction     = 'shop_menu'
			CurrentActionMsg  = 'Appuez sur ~INPUT_CONTEXT~ pour accéder au menu'
			CurrentActionData = {}

			if IsAnyVehicleNearPoint(Config.Zones.ShopInside.Pos.x, Config.Zones.ShopInside.Pos.y, Config.Zones.ShopInside.Pos.z, 3.0) then
					
				local vehicle, distance = ESX.Game.GetClosestVehicle({
					x = Config.Zones.ShopInside.Pos.x,
					y = Config.Zones.ShopInside.Pos.y,
					z = Config.Zones.ShopInside.Pos.z
				})
				
				if distance <= 3.0 then
					DeleteVehicle(vehicle)
				end
			
			end

			FreezeEntityPosition(playerPed, false)
			SetEntityVisible(playerPed, true)

			if Config.EnablePlayerManagement then
				SetEntityCoords(playerPed, Config.Zones.BossActions.Pos.x, Config.Zones.BossActions.Pos.y, Config.Zones.BossActions.Pos.z)
			else
				SetEntityCoords(playerPed, Config.Zones.ShopEntering.Pos.x, Config.Zones.ShopEntering.Pos.y, Config.Zones.ShopEntering.Pos.z)
			end

		end,
		function(data, menu)

			local vehicleData = vehiclesByCategory[data.current.name][data.current.value + 1]
			local playerPed   = GetPlayerPed(-1)

			if IsAnyVehicleNearPoint(Config.Zones.ShopInside.Pos.x, Config.Zones.ShopInside.Pos.y, Config.Zones.ShopInside.Pos.z, 3.0) then
					
				local vehicle, distance = ESX.Game.GetClosestVehicle({
					x = Config.Zones.ShopInside.Pos.x,
					y = Config.Zones.ShopInside.Pos.y,
					z = Config.Zones.ShopInside.Pos.z
				})
				
				if distance <= 3.0 then
					DeleteVehicle(vehicle)
				end
			
			end

			ESX.Game.SpawnLocalVehicle(vehicleData.model, {
				x = Config.Zones.ShopInside.Pos.x,
				y = Config.Zones.ShopInside.Pos.y,
				z = Config.Zones.ShopInside.Pos.z
			}, 90.0, function(vehicle)
				CurrentVehicle = vehicle
				TaskWarpPedIntoVehicle(playerPed, vehicle, -1)
				FreezeEntityPosition(vehicle, true)
			end)

		end
	)

	if IsAnyVehicleNearPoint(Config.Zones.ShopInside.Pos.x, Config.Zones.ShopInside.Pos.y, Config.Zones.ShopInside.Pos.z, 3.0) then
			
		local vehicle, distance = ESX.Game.GetClosestVehicle({
			x = Config.Zones.ShopInside.Pos.x,
			y = Config.Zones.ShopInside.Pos.y,
			z = Config.Zones.ShopInside.Pos.z
		})
		
		if distance <= 3.0 then
			DeleteVehicle(vehicle)
		end
	
	end

	ESX.Game.SpawnLocalVehicle(firstVehicleData.model, {
		x = Config.Zones.ShopInside.Pos.x,
		y = Config.Zones.ShopInside.Pos.y,
		z = Config.Zones.ShopInside.Pos.z
	}, 90.0, function(vehicle)
		CurrentVehicle = vehicle
		TaskWarpPedIntoVehicle(playerPed, vehicle, -1)
		FreezeEntityPosition(vehicle, true)
	end)

end

function OpenResellerMenu()

	ESX.UI.Menu.CloseAll()

	ESX.UI.Menu.Open(
		'default', GetCurrentResourceName(), 'reseller',
		{
			title    = 'Concessionnaire',
			align    = 'top-left',
			elements = {
		  	{label = 'Sortir véhicule',              value = 'pop_vehicle'},
		  	{label = 'Rentrer véhicule',             value = 'depop_vehicle'},
		  	{label = 'Créer facture',                value = 'create_bill'},
		  	{label = 'Véhicules en location',        value = 'get_rented_vehicles'},	
		  	{label = 'Attribuer véhicule [Vente]',   value = 'set_vehicle_owner_sell'},		
		  	{label = 'Attribuer véhicule [Location]', value = 'set_vehicle_owner_rent'},
			}
		},
		function(data, menu)

			if data.current.value == 'pop_vehicle' then
				OpenPopVehicleMenu()
			end

			if data.current.value == 'depop_vehicle' then

				if IsAnyVehicleNearPoint(Config.Zones.ShopInside.Pos.x, Config.Zones.ShopInside.Pos.y, Config.Zones.ShopInside.Pos.z, 3.0) then
					local vehicle = GetClosestVehicle(Config.Zones.ShopInside.Pos.x, Config.Zones.ShopInside.Pos.y, Config.Zones.ShopInside.Pos.z, 3.0, 0, 71)
					DeleteVehicle(vehicle)
				end

			end

			if data.current.value == 'create_bill' then

				ESX.UI.Menu.Open(
					'dialog', GetCurrentResourceName(), 'set_vehicle_owner_sell_amount',
					{
						title = 'Montant de la facture'
					},
					function(data2, menu)

						local amount = tonumber(data2.value)

						if amount == nil then
							ESX.ShowNotification('Montant invalide')
						else
							
							menu.close()

							local closestPlayer, closestDistance = ESX.Game.GetClosestPlayer()

							if closestPlayer == -1 or closestDistance > 3.0 then
								ESX.ShowNotification('Aucun joueur à proximité')
							else
								TriggerServerEvent('esx_billing:sendBill', GetPlayerServerId(closestPlayer), 'society_realestateagent', 'Concessionnaire', tonumber(data2.value))
							end

						end

					end,
					function(data2, menu)
						menu.close()
					end
				)

			end

			if data.current.value == 'get_rented_vehicles' then
				OpenRentedVehiclesMenu()
			end

			if data.current.value == 'set_vehicle_owner_sell' then

				local closestPlayer, closestDistance = ESX.Game.GetClosestPlayer()

				if closestPlayer == -1 or closestDistance > 3.0 then
					ESX.ShowNotification('Aucun joueur à proximité')
				else

					local vehicleProps = ESX.Game.GetVehicleProperties(CurrentVehicle)
					local model        = CurrentVehicleData.model

					TriggerServerEvent('esx_vehicleshop:sellVehicle', model)
					TriggerServerEvent('esx_vehicleshop:setVehicleOwnedPlayerId', GetPlayerServerId(closestPlayer), vehicleProps)
				end

			end

			if data.current.value == 'set_vehicle_owner_rent' then

				ESX.UI.Menu.Open(
					'dialog', GetCurrentResourceName(), 'set_vehicle_owner_rent_amount',
					{
						title = 'Montant de la location'
					},
					function(data2, menu)

						local amount = tonumber(data2.value)

						if amount == nil then
							ESX.ShowNotification('Montant invalide')
						else
							
							menu.close()

							local closestPlayer, closestDistance = ESX.Game.GetClosestPlayer()

							if closestPlayer == -1 or closestDistance > 3.0 then
								ESX.ShowNotification('Aucun joueur à proximité')
							else

								SetVehicleNumberPlateText(CurrentVehicle, 'LOC ' .. ESX.GetRandomString(5))

								local vehicleProps = ESX.Game.GetVehicleProperties(CurrentVehicle)
								local model        = CurrentVehicleData.model

								TriggerServerEvent('esx_vehicleshop:rentVehicle', model, vehicleProps.plate, GetPlayerName(closestPlayer), CurrentVehicleData.price, amount, GetPlayerServerId(closestPlayer))
								TriggerServerEvent('esx_vehicleshop:setVehicleOwnedPlayerId', GetPlayerServerId(closestPlayer), vehicleProps)
								TriggerServerEvent('esx_vehicleshop:setVehicleForAllPlayers', vehicleProps, Config.Zones.ShopInside.Pos.x, Config.Zones.ShopInside.Pos.y, Config.Zones.ShopInside.Pos.z, 5.0)
							end

						end

					end,
					function(data2, menu)
						menu.close()
					end
				)

			end

		end,
		function(data, menu)
			
			menu.close()

			CurrentAction     = 'reseller_menu'
			CurrentActionMsg  = 'Appuez sur ~INPUT_CONTEXT~ pour accéder au menu'
			CurrentActionData = {}

		end
	)

end

function OpenPersonnalVehicleMenu()

	ESX.UI.Menu.CloseAll()

	ESX.TriggerServerCallback('esx_vehicleshop:getPersonnalVehicles', function(vehicles)

		local elements = {}

		for i=1, #vehicles, 1 do
			for j=1, #Vehicles, 1 do
				if vehicles[i].model == GetHashKey(Vehicles[j].model) then
					vehicles[i].name = Vehicles[j].name
				end
			end
		end

		for i=1, #vehicles, 1 do
			table.insert(elements, {label = vehicles[i].name .. ' [' .. vehicles[i].plate .. ']', value = vehicles[i]})
		end

		ESX.UI.Menu.Open(
			'default', GetCurrentResourceName(), 'personnal_vehicle',
			{
				title    = 'Véhicule personnel',
				align    = 'top-left',
				elements = elements
			},
			function(data, menu)
					
				local playerPed   = GetPlayerPed(-1)
				local coords      = GetEntityCoords(playerPed)
				local heading     = GetEntityHeading(playerPed)
				local vehicleData = data.current.value

				menu.close()

				ESX.Game.SpawnLocalVehicle(vehicleData.model, {
					x = coords.x,
					y = coords.y,
					z = coords.z
				}, heading, function(vehicle)
					ESX.Game.SetVehicleProperties(vehicle, vehicleData)
					TaskWarpPedIntoVehicle(playerPed, vehicle, -1)
				end)
			end,
			function(data, menu)
				menu.close()
			end
		)

	end)

end

function OpenPopVehicleMenu()

	ESX.TriggerServerCallback('esx_vehicleshop:getCommercialVehicles', function(vehicles)

		local elements = {}

		for i=1, #vehicles, 1 do
			table.insert(elements, {label = vehicles[i].name .. ' $' .. vehicles[i].price, value = vehicles[i].name})
		end

		ESX.UI.Menu.Open(
			'default', GetCurrentResourceName(), 'commercial_vehicles',
			{
				title    = 'Concessionnaire - Véhicules',
				align    = 'top-left',
				elements = elements
			},
			function(data, menu)

				local model = data.current.value

				if IsAnyVehicleNearPoint(Config.Zones.ShopInside.Pos.x, Config.Zones.ShopInside.Pos.y, Config.Zones.ShopInside.Pos.z, 3.0) then
					local vehicle = GetClosestVehicle(Config.Zones.ShopInside.Pos.x, Config.Zones.ShopInside.Pos.y, Config.Zones.ShopInside.Pos.z, 3.0, 0, 71)
					DeleteVehicle(vehicle)
				end

				ESX.Game.SpawnLocalVehicle(model, {
					x = Config.Zones.ShopInside.Pos.x,
					y = Config.Zones.ShopInside.Pos.y,
					z = Config.Zones.ShopInside.Pos.z
				}, 90.0, function(vehicle)
					
					CurrentVehicle = vehicle

					for i=1, #Vehicles, 1 do
						if model == Vehicles[i].model then
							CurrentVehicleData = Vehicles[i]
						end
					end

				end)

			end,
			function(data, menu)
				menu.close()
			end
		)

	end)

end

