				align    = 'top-left',
				elements = elements
			},
			nil,
			function(data, menu)
				menu.close()
			end
		)

	end)

end

function OpenBossActionsMenu()

	ESX.UI.Menu.CloseAll()

	ESX.UI.Menu.Open(
		'default', GetCurrentResourceName(), 'reseller',
		{
			title    = 'Concessionnaire - Patron',
			align    = 'top-left',
			elements = {
		  	{label = 'Acheter véhicule',      value = 'buy_vehicle'},
		  	{label = 'Retirer argent société', value = 'withdraw_society_money'},
		  	{label = 'Déposer argent ',       value = 'deposit_money'},
		  	{label = 'Blanchir argent',       value = 'wash_money'}
			}
		},
		function(data, menu)

			if data.current.value == 'buy_vehicle' then
				OpenShopMenu()
			end

			if data.current.value == 'withdraw_society_money' then

				ESX.UI.Menu.Open(
					'dialog', GetCurrentResourceName(), 'withdraw_society_money_amount',
					{
						title = 'Montant du retrait'
					},
					function(data, menu)

						local amount = tonumber(data.value)

						if amount == nil then
							ESX.ShowNotification('Montant invalide')
						else
							menu.close()
							TriggerServerEvent('esx_society:withdrawMoney', 'cardealer', amount)
						end

					end,
					function(data, menu)
						menu.close()
					end
				)

			end

			if data.current.value == 'deposit_money' then

				ESX.UI.Menu.Open(
					'dialog', GetCurrentResourceName(), 'deposit_money_amount',
					{
						title = 'Montant du dépôt'
					},
					function(data, menu)

						local amount = tonumber(data.value)

						if amount == nil then
							ESX.ShowNotification('Montant invalide')
						else
							menu.close()
							TriggerServerEvent('esx_society:depositMoney', 'cardealer', amount)
						end

					end,
					function(data, menu)
						menu.close()
					end
				)

			end

			if data.current.value == 'wash_money' then

				ESX.UI.Menu.Open(
					'dialog', GetCurrentResourceName(), 'wash_money_amount',
					{
						title = 'Montant à blanchir'
					},
					function(data, menu)

						local amount = tonumber(data.value)

						if amount == nil then
							ESX.ShowNotification('Montant invalide')
						else
							menu.close()
							TriggerServerEvent('esx_society:washMoney', 'cardealer', amount)
						end

					end,
					function(data, menu)
						menu.close()
					end
				)

			end

		end,
		function(data, menu)
			
			menu.close()

			CurrentAction     = 'boss_actions_menu'
			CurrentActionMsg  = 'Appuez sur ~INPUT_CONTEXT~ pour accéder au menu'
			CurrentActionData = {}

		end
	)

end

RegisterNetEvent('esx:playerLoaded')
AddEventHandler('esx:playerLoaded', function(xPlayer)
	
	PlayerData = xPlayer

	if Config.EnablePlayerManagement then

		if PlayerData.job.name == 'cardealer' then

			Config.Zones.ShopEntering.Type = 1

			if PlayerData.job.grade_name == 'boss' then
				Config.Zones.BossActions.Type = 1
			end

		else
			Config.Zones.ShopEntering.Type = -1
			Config.Zones.BossActions.Type  = -1
		end

	end

end)

RegisterNetEvent('esx:setJob')
AddEventHandler('esx:setJob', function(job)
	
	PlayerData.job = job

	if Config.EnablePlayerManagement then

		if PlayerData.job.name == 'cardealer' then

			Config.Zones.ShopEntering.Type = 1

			if PlayerData.job.grade_name == 'boss' then
				Config.Zones.BossActions.Type = 1
			end

		else
			Config.Zones.ShopEntering.Type = -1
			Config.Zones.BossActions.Type  = -1
		end

	end

end)

RegisterNetEvent('esx_vehicleshop:openPersonnalVehicleMenu')
AddEventHandler('esx_vehicleshop:openPersonnalVehicleMenu', function()
	OpenPersonnalVehicleMenu()
end)

AddEventHandler('esx_vehicleshop:hasEnteredMarker', function(zone)

	if zone == 'ShopEntering' then

		if Config.EnablePlayerManagement then

			if PlayerData.job ~= nil and PlayerData.job.name == 'cardealer' then
				CurrentAction     = 'reseller_menu'
				CurrentActionMsg  = 'Appuez sur ~INPUT_CONTEXT~ pour accéder au menu'
				CurrentActionData = {}
			end

		else

			CurrentAction     = 'shop_menu'
			CurrentActionMsg  = 'Appuez sur ~INPUT_CONTEXT~ pour accéder au menu'
			CurrentActionData = {}

		end

	end

	if zone == 'GiveBackVehicle' and Config.EnablePlayerManagement then

		local playerPed = GetPlayerPed(-1)

		if IsPedInAnyVehicle(playerPed, false) then
			
			local vehicle = GetVehiclePedIsIn(playerPed, false)

			CurrentAction     = 'give_back_vehicle'
			CurrentActionMsg  = 'Appuez sur ~INPUT_CONTEXT~ pour rendre votre véhicule'
			
			CurrentActionData = {
				vehicle = vehicle
			}

		end

	end

	if zone == 'ResellVehicle' then

		local playerPed = GetPlayerPed(-1)

		if IsPedInAnyVehicle(playerPed, false) then

			local vehicle     = GetVehiclePedIsIn(playerPed, false)
			local vehicleData = nil

			for i=1, #Vehicles, 1 do
				if GetHashKey(Vehicles[i].model) == GetEntityModel(vehicle) then
					vehicleData = Vehicles[i]
					break
				end
			end

			local resellPrice = math.floor(vehicleData.price / 100 * Config.ResellPercentage)

			CurrentAction     = 'resell_vehicle'
			CurrentActionMsg  = 'Appuez sur ~INPUT_CONTEXT~ pour vendre ' .. vehicleData.name .. ' au prix de $' .. resellPrice
			
			CurrentActionData = {
				vehicle = vehicle,
				price   = resellPrice
			}

		end

	end

	if zone == 'BossActions' and PlayerData.job ~= nil and PlayerData.job.name == 'cardealer' and PlayerData.job.grade_name == 'boss' then

		CurrentAction     = 'boss_actions_menu'
		CurrentActionMsg  = 'Appuez sur ~INPUT_CONTEXT~ pour accéder au menu'
		CurrentActionData = {}

	end

end)

